const dangerList = (options) => {
  const data = getBody(options)
  const result = []
  const current = parseInt(data.current)
  const size = parseInt(data.size)
  const totalPage = Math.ceil(totalCount / size)
  const next = (current >= totalPage ? (totalCount % size) : size) + 1
  for (let i = 1; i < next; i++) {
    result.push({
      id: Mock.mock('@integer(100, 199)'),
      regionId: Mock.mock('@integer(10000, 19999)'),
      dangerName: dangerName[Mock.mock('@integer(0, 1)')],
      dangerLevel: dangerLevel[Mock.mock('@integer(0, 3)')],
      dangerType: dangerType[Mock.mock('@integer(0, 2)')],
      safeDistance: Mock.mock('@integer(100, 199)'),
      personNum: Mock.mock('@integer(10, 99)'),
      vesselTotal: Mock.mock('@integer(100, 199)'),
      vesselsTotal: Mock.mock('@integer(200, 399)'),
      productType: '化工',
      productProperty: '',
      valueR: Mock.mock('@integer(100, 999)'),
      address: Mock.Random.county(),
      longitude: Mock.mock('@integer(130, 135)'),
      latitude: Mock.mock('@integer(130, 135)'),
      startTime: Mock.mock('@datetime'),
      endTime: Mock.mock('@datetime'),
      accidentType: Mock.mock(),
      accidentNum: Mock.mock('@integer(10, 19)'),
      mainProduction: '产品',
      remark: ''
    })
  }
  return builder({
    size: size,
    current: current,
    total: totalCount,
    pages: totalPage,
    records: result
  })
}
